tion that depends on space or time into\n         a function depending on spatial of temporal frequency.  For example you can use a Fourier transform\n         on an audio signal that varies in amplitude over time to determine the frequencies the audio signal\n         is composed of. The transform is defined by the following equation: \n             &lt;/div&gt;\n         "},"id":"47821","type":"Div"},{"attributes":{},"id":"47753","type":"ResetTool"},{"attributes":{},"id":"47798","type":"HelpTool"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"47717","type":"BoxAnnotation"},{"attributes":{"axis_label":"Frequency in Hz","formatter":{"id":"47857"},"major_label_policy":{"id":"47855"},"ticker":{"id":"47786"}},"id":"47785","type":"LinearAxis"},{"attributes":{},"id":"47786","type":"BasicTicker"},{"attributes":{"axis":{"id":"47785"},"ticker":null},"id":"47788","type":"Grid"},{"attributes":{},"id":"47752","type":"SaveTool"},{"attributes":{},"id":"47750","type":"WheelZoomTool"},{"attributes":{"axis":{"id":"47789"},"dimension":1,"ticker":null},"id":"47792","type":"Grid"},{"attributes":{},"id":"47749","type":"PanTool"},{"attributes":{"overlay":{"id":"47755"}},"id":"47751","type":"BoxZoomTool"},{"attributes":{},"id":"47790","type":"BasicTicker"},{"attributes":{"style":{"font-size":"200%","text-align":"center"},"text":"\n          &lt;math&gt; \n          X(&lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;n&lt;/mn&gt;&lt;/msub&gt;) = \n          &lt;msubsup&gt;&lt;mo&gt;&amp;sum;&lt;/mo&gt;&lt;mn&gt;k&lt;/mn&gt;&lt;mo&gt;N&lt;/mo&gt;&lt;/msubsup&gt; &lt;msub&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mn&gt;t&lt;/mn&gt;&lt;/msub&gt; &lt;msup&gt;&lt;mi&gt;e&lt;/mi&gt;&lt;mo&gt;-2&amp;pi;i(fn)k&amp;Delta;t&lt;/mo&gt;&lt;/msup&gt; &lt;mi&gt;,  (Eq. 2)&lt;/mi&gt;\n          &lt;/math&gt;\n          &lt;br&gt;\n          &lt;math&gt;\n          where &lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;n&lt;/mn&gt;&lt;/msub&gt; are the so called Fourier frequencies and are defined by\n          &lt;/math&gt;\n          &lt;br&gt;\n          &lt;math&gt;\n          &lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;n&lt;/mn&gt;&lt;/msub&gt; = &lt;mfrac&gt; &lt;mi&gt;n&lt;/mi&gt; &lt;mi&gt;N&amp;Delta;t&lt;/mi&gt; &lt;/mfrac&gt;&lt;mi&gt;, (Eq. 3)&lt;/mi&gt;\n          &lt;/math&gt;\n          &lt;br&gt;\n          &lt;math&gt;\n          which means Eq. 2 can be simplified to\n          &lt;/math&gt;\n          &lt;br&gt;\n          &lt;math&gt; \n          X(&lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;n&lt;/mn&gt;&lt;/msub&gt;) = \n          &lt;msubsup&gt;&lt;mo&gt;&amp;sum;&lt;/mo&gt;&lt;mn&gt;k&lt;/mn&gt;&lt;mo&gt;N&lt;/mo&gt;&lt;/msubsup&gt; &lt;msub&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mn&gt;t&lt;/mn&gt;&lt;/msub&gt; &lt;msup&gt;&lt;mi&gt;e&lt;/mi&gt;&lt;mo&gt;-2&amp;pi;ink/N&lt;/msup&gt;&lt;mi&gt;,  (Eq. 4)&lt;/mi&gt;\n          &lt;/math&gt;\n          &lt;br&gt;\n          &lt;math&gt;\n          _______________________________________________________________________________________________________________________________________________________\n          &lt;/math&gt;\n         "},"id":"47825","type":"Div"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"47678","type":"BoxAnnotation"},{"attributes":{},"id":"47673","type":"WheelZoomTool"},{"attributes":{},"id":"47794","type":"WheelZoomTool"},{"attributes":{},"id":"47793","type":"PanTool"},{"attributes":{},"id":"47754","type":"HelpTool"},{"attributes":{"overlay":{"id":"47799"}},"id":"47795","type":"BoxZoomTool"},{"attributes":{},"id":"47796","type":"SaveTool"},{"attributes":{},"id":"47797","type":"ResetTool"},{"attributes":{},"id":"47672","type":"PanTool"},{"attributes":{"children":[{"id":"47819"},{"id":"47820"},{"id":"47821"},{"id":"47822"},{"id":"47823"},{"id":"47824"},{"id":"47825"},{"id":"47827"},{"id":"47653"},{"id":"47828"},{"id":"47692"},{"id":"47730"},{"id":"47817"},{"id":"47774"}]},"id":"47829","type":"Column"},{"attributes":{"style":{"font-size":"200%","text-align":"center"},"text":"\n         &lt;math&gt;\n         For the following plot we take N=100 measurements over a 40 second period of the following time series function\n         &lt;/math&gt;\n         &lt;br&gt;\n         &lt;math&gt;\n         &lt;msub&gt;&lt;mi&gt;x&lt;/mi&gt;&lt;mn&gt;1&lt;/mn&gt;&lt;/msub&gt;(t) = sin(2&amp;pi;&lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;1&lt;/mn&gt;&lt;/msub&gt;) + 0.3sin(2&amp;pi;&lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msub&gt;) + random noise, where\n         &lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;1&lt;/mn&gt;&lt;/msub&gt; &amp;thickapprox; 0.5 Hz and &lt;msub&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mn&gt;2&lt;/mn&gt;&lt;/msub&gt; &amp;thickapprox; 0.25 Hz\n         &lt;/math&gt;\n         "},"id":"47827","type":"Div"},{"attributes":{"style":{"font-family":"Georgia, serif","font-size":"200%"},"text":"\n         &lt;div&gt;\n         We then do a discrete Fourier transform and plot the values against the Fourier frequencies.  We can see two peaks in the series at 0.25 and 0.5 Hz which\n         correspond to the two frequencies that make up the signal.  It's important to note that the plot only includes half the values since the full plot is symmetrical about 0.\n         &lt;/div&gt;\n         "},"id":"47828","type":"Div"},{"attributes":{},"id":"47865","type":"Selection"},{"attributes":{"source":{"id":"47691"}},"id":"47729","type":"CDSView"},{"attributes":{},"id":"47866","type":"UnionRenderers"},{"attributes":{"line_color":"#1f77b4","x":{"field":"f"},"y":{"field":"x1_FFT"}},"id":"47726","type":"Line"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"f"},"y":{"field":"x1_FFT"}},"id":"47727","type":"Line"},{"attributes":{},"id":"47716","type":"HelpTool"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"47799","type":"BoxAnnotation"},{"attributes":{},"id":"47733","type":"DataRange1d"},{"attributes":{"data_source":{"id":"47652"},"glyph":{"id":"47764"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"47765"},"view":{"id":"47767"}},"id":"47766","type":"GlyphRenderer"},{"attributes":{"text":"Signals x2 and x3 over time"},"id":"47731","type":"Title"},{"attributes":{"style":{"font-size":"200%","text-align":"center"},"text":"\n          &lt;math&gt; \n          &lt;mover&gt;&lt;mi&gt;f&lt;/mi&gt;&lt;mo&gt;&amp;Hat;&lt;/mo&gt;&lt;/mover&gt; (&amp;xi;) = \n          &lt;msubsup&gt;&lt;mo&gt;&amp;Integral;&lt;/mo&gt;&lt;mn&gt;-&amp;infin;&lt;/mn&gt;&lt;mo&gt;&amp;infin;&lt;/mo&gt;&lt;/msubsup&gt; f(x) &lt;msup&gt;&lt;mi&gt;e&lt;/mi&gt;&lt;mo&gt;-2&amp;pi;ix&amp;xi;&lt;/mo&gt;&lt;/msup&gt; &lt;mi&gt;dx,  (Eq. 1)&lt;/mi&gt;\n          _______________________________________________________________________________________________________________________________________________________\n          &lt;/math&gt;\n         "},"id":"47822","type":"Div"},{"attributes":{"source":{"id":"47651"}},"id":"47690","type":"CDSView"},{"attributes":{},"id":"47735","type":"DataRange1d"},{"attributes":{"active_multi":null,"tools":[{"id":"47749"},{"id":"47750"},{"id":"47751"},{"id":"47752"},{"id":"47753"},{"id":"47754"}]},"id":"47756","type":"Toolbar"},{"attributes":{},"id":"47737","type":"LinearScale"},{"attributes":{"line_color":"#1f77b4","x":{"field":"t"},"y":{"field":"x1"}},"id":"47687","type":"Line"},{"attributes":{"line_alpha":0.1,"line_color":"#1f77b4","x":{"field":"t"},"y":{"field":"x1"}},"id":"
